import React from 'react';
import AppHeader from './navigation/header/Header'
import { StylesProvider } from '@material-ui/core';
import BooksList from './Books/booksList/BooksList';

function App() {
  return (
    <div>
    <StylesProvider injectFirst>
      <AppHeader />
      <BooksList />
    </StylesProvider>
    </div>
  );
}

export default App;
